// Extract unique states and years
const states = [...new Set(data.map(d => d.State))];
const years = [...new Set(data.map(d => d.Year))];

// Populate state dropdown
const stateDropdown = d3.select("#selState");
states.forEach(state => {
    stateDropdown.append("option").text(state).attr("value", state);
});

// Populate year dropdown
const yearDropdown = d3.select("#selYear");
years.forEach(year => {
    yearDropdown.append("option").text(year).attr("value", year);
});

// Set default selection
stateDropdown.property("value", states[0]);
yearDropdown.property("value", years[0]);

// Function to update chart based on selected state and year
function updateChart() {
    const selectedState = stateDropdown.property("value");
    const selectedYear = yearDropdown.property("value");

    // Filter data based on selected state and year
    const filteredData = data.filter(d => d.State === selectedState && d.Year === selectedYear);

    // Extract categories and values for plotting
    const categories = filteredData.map(d => d.Category);
    const values = filteredData.map(d => +d.Value);

    // Create the bar chart
    const trace = {
        x: values,
        y: categories,
        type: 'bar',
        orientation: 'h',
        marker: { color: 'rgba(777,117,154)' }
    };

    const layout = {
        title: `Income Categories in ${selectedState} (${selectedYear})`,
        xaxis: { title: 'Population Count' },
        yaxis: {automargin: true},
        margin:{l: 150, r: 20, t: 50, b: 50}
    };

    Plotly.newPlot('bar-chart', [trace], layout);
}

// Update chart when state or year is changed
stateDropdown.on("change", updateChart);
yearDropdown.on("change", updateChart);

// Initial chart display
updateChart();
